webpackJsonp([0x9bbd30d08de],{5138:function(t,e){t.exports={data:{post:{html:'<p>Lots going on, lots to think about this week. No <a href="http://brdbrain.editthispage.com/2000/09/10">time to update the weblog</a>. New <a href="http://www.abendblatt.de/bin/ha/set_frame/set_frame.cgi?seiten_url=/contents/ha/news/wirtschaft/html/090900/219AUFM16.HTM">CEO</a> at work, and no idea what it all means. Big decisions? We\'ll see.</p>\n<p>But hey, we\'ll be taking pictures for the big <a href="http://array.editthispage.com/24hours">weblog shootout</a> this coming Sunday and Monday. Christopher nonstop. But will it be as much fun as the German weblog rally? We\'ll see.</p>\n<p><a href="http://array.editthispage.com/24hours"><img src="http://www.arrayweb.com/btc/english.jpg" /></a></p>',fields:{title:"Busy busy",date:"12 Sep 2000",url:"https://papascott.de/2000-09-12-busy-busy/"}}},pathContext:{slug:"/2000-09-12-busy-busy/",prev:{fields:{title:"Happy Anniversary to Us",date:"06 Sep 2000",slug:"/2000-09-06-happy-anniversary-to-us/"}},next:{fields:{title:"Olympic Shootout",date:"17 Sep 2000",slug:"/2000-09-17-olympic-shootout/"}}}}}});
